  //     </Menu.Item>
  //   </Menu>
  // );


  return (
    <nav className="navbar">
      <DropdownButton id="dropdown-basic-button" title="Dropdown button">
        <Dropdown.Item href="/exercises">Exercise List</Dropdown.Item>
        <Dropdown.Item href="/add-exercise">Add Exercise</Dropdown.Item>
        <Dropdown.Item href="/dashboard">Clients</Dropdown.Item>
        <Dropdown.Item href="/add">Add Client</Dropdown.Item>
        <Dropdown.Item href="/" onClick={ logout }>Logout</Dropdown.Item>
      </DropdownButton>
    </nav>
  );
};
Navbar.propTypes = {
  logout: PropTypes.func.isRequired,
};

export default connect(null, { logout })(Navbar);
